import React, {useState} from 'react';

function Album(props) {
    console.log(props)
    return (
        <div>
            <img src={props.image} alt={props.title}/>
            <h3>{props.title}</h3>
            <p>{props.artist}</p>
        </div>
    )
}

export default Album;
